import React,{useState} from 'react';
import { useDispatch } from "react-redux";
import { useHistory } from 'react-router-dom';
import  {addName, addEmail, addPassword} from '../actions/usersAction'
import { useSelector } from 'react-redux'

function Account() {

    const history = useHistory();
    const nameState = useSelector((state) => {return state.nameReducer});
    const emailState = useSelector((state) => {return state.emailReducer});
    const passwordState = useSelector((state) => {return state.passwordReducer});
    console.log(nameState)
    console.log(emailState)
    console.log(passwordState)




    const [name, setName] =  useState('');
    const [email, setEmail] =  useState('');
    const [password, setPassword] =  useState('');

    const dispatch = useDispatch();


    dispatch(addName(name))
    dispatch(addEmail(email))
    dispatch(addPassword(password))


    return (
        <div>
                <h1>Ditt konto</h1>

            <label >NAME </label><br />
            <input type="text" onChange={ (e) => setName(e.target.value)}placeholder={nameState}/><br />

            <label >EMAIL</label><br />
            <input type="text" onChange={ (e) => setEmail(e.target.value)} placeholder={emailState}/><br />

            <label >PASSWORD</label><br />
            <input type="password" onChange={ (e) => setPassword(e.target.value)} placeholder={passwordState}/><br />

            <button onClick = {() => history.push('/change')}>Spara</button>


        </div>




    )
}

export default Account;
